int getCount(Context& ctx, bitset<30>& maxOr, int index)
{
    int maxCount{};
    int bitcount = maxOr.count();
    auto size = maxOr.size();

    for (int bit = 0; bit < size; ++bit)
    {
        if (maxOr.test(bit))
        {
            auto count = getNearestWithBitSet(ctx, index, bit);
            if (count > maxCount)
                maxCount = count;
        }
    }

    return maxCount;
}

void updateLeftmostBits(Context& ctx, mybitset num, int index)
{
    auto size = num.size();

    for (auto i = 0; i < size; ++i)
    {
        if (num[i])
        {
            ctx.leftmostPosnBitSet[i] = index;
        }
    }
}

class Solution {
public:
    vector<int> smallestSubarrays(vector<int>& nums) {
        Context ctx(nums, 30);   // 30 bit integer is max for problem at hand
        int rightmostIndex = nums.size() - 1;

        // Fill out the known rightmost values
        mybitset maxOr = nums[rightmostIndex];
        ctx.smallestSubVec[rightmostIndex] = 1;

        updateLeftmostBits(ctx, maxOr, rightmostIndex);

        // iterate over the vector from right to left: TODO is there a way to use a transform?
        for (int index = rightmostIndex - 1; index >= 0; --index)
        {
            mybitset current = nums[index];
            updateLeftmostBits(ctx, current, index);
            auto newOr = current | maxOr;

            if (current == maxOr)
            {
                ctx.smallestSubVec[index] = 1;
            }
            else if (0 == current.count())
            {
                ctx.smallestSubVec[index] = ctx.smallestSubVec[index + 1] + 1;
            }
            else
            {
                maxOr = newOr;
                ctx.smallestSubVec[index] = getCount(ctx, maxOr, index);
            }

        }

        return ctx.smallestSubVec;
    }

};


